      | 355067 -> { ItemTypeData.id= 355067; name= "PRO Drone Mass Driver"; published= false; description= "The Mass Driver is a semi-automatic, multi-shot grenade launcher useful as both a breaching tool and area denial weapon. Firing smart HIND explosive rounds, the weapon is highly effective against all forms of dropsuit and light vehicle, while its lightweight frame and compact design make it easy to wield in both urban and open terrain engagements."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
